export default function(state=null, action){
    switch(action.type){
        case 'TASK_CHECKED':
            console.log('TASK_CHECKED');
            state = {
                ...state,
                status: 'Y'
            };
            break;
        case 'TASK_UNCHECKED':
            console.log('TASK_UNCHECKED');
            state = {
                ...state,
                status: 'N'
            };
            break;
    }
    console.log(state);
    return state;
}
